<?xml version="1.0" encoding="UTF-8" ?>
<html xmlns="http://www.w3.org/1999/xhtml"
    xmlns:xsd="http://www.w3.org/2001/XMLSchema#"
    xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#"
    xmlns:rdfs="http://www.w3.org/2000/01/rdf-schema#"
    xmlns:calli="http://callimachusproject.org/rdf/2009/framework#">
<head>
    <title resource="?this">{rdfs:label}</title>
    <link rel="edit-form" href="?edit" />
    <link rel="comments" href="?discussion" />
    <link rel="describedby" href="?describe" />
    <link rel="version-history" href="?history" />
</head>
<body resource="?this">
    <h1 property="rdfs:label" />
    <pre class="wiki" property="rdfs:comment" />
    <p property="calli:copy" content="?copy">Copy (200) <a href="{?copy}">{?copy}</a></p>
    <p property="calli:canonical" content="?canonical">Canonical (301) <a href="{?canonical}">{?canonical}</a></p>
    <p property="calli:alternate" content="?alternate">Alternate (302) <a href="{?alternate}">{?alternate}</a></p>
    <p property="calli:describedby" content="?describedby">Described by (303) <a href="{?describedby}">{?describedby}</a></p>
    <p property="calli:resides" content="?resides">Resides (307) <a href="{?resides}">{?resides}</a></p>
    <p property="calli:moved" content="?moved">Moved (308) <a href="{?moved}">{?moved}</a></p>
    <p property="calli:missing" content="?missing">Missing (404) <a href="{?missing}">{?missing}</a></p>
    <p property="calli:gone" content="?gone">Gone (410) <a href="{?gone}">{?gone}</a></p>
    <p property="calli:cacheControl" content="?cacheControl">Cache-Control: {?cacheControl}</p>
</body>
</html>
